      promoted, supported, attacked or opposed any such candidate for Federal office.
      All expenditures to individuals for rent that do not have a subsequent memo
      of itemization, represent rent income to those individuals and are not required
      to be itemized. The salaries and related fringe benefits of employees of the
      Committee who spent more than 25% of their compensated time during the month
      of February engaged in Federal Election Activity are reported on Schedule B
      Line 30(b). Payments for salaries and related fringe benefits disclosed on Schedule
      H4 are for employees who spent less than 25% of their time engaged in activities
      in connection to any federal election. The Committee uses the Escrow option
      for receipt of corporate in-kind donations as provided for by the Commission
      in Advisory Opinion 1992-33. The method ensures that prohibited sources are
      not used to fund the federal share of allocable activity expenses. In-kind details
      and the escrow account activity are summarized as follows:   COMBINED ESCROW
      BALANCE OF $15,221.74 as of 1/31/14.   2/12/14 Transfer to MD-14 escrow acct
